import React from 'react';
import PropTypes from 'prop-types';
import styled from 'styled-components';
import { css } from 'styled-components';

const StyledSpan = styled.span`
    font-family: tryout-icons;
    @mixin emoji($size) {
        font-size: $size;
    }

    &.heart::before {
        @include emoji(24px);
        content: '\f3dc'
    }

    &.heart-empty::before {
        @include emoji(24px);
        content: '\f3db'
    }

    &.ellipsis::before {
        @include emoji(16px);
        content: '\f12c'
    }

    &.music::before {
        @include emoji(16px);
        content: '\f156'
    }
`

function Emoji({ name })  {
    return (
        <StyledSpan className={name} role="img" aria-label={name} />
    )
}

Emoji.defaultProps = {
    name: "heart-empty"
}

Emoji.propTypes = {
    name: PropTypes.oneOf(["heart","heart-empty","ellipsis","music"])
}

export default Emoji;
